import { 
    GET_LOGS, 
    SET_LOADING, 
    LOGS_ERROR, 
    // ADD_LOG, 
    // DELETE_LOG, 
    // UPDATE_LOG,
    // SEARCH_LOGS, 
    // SET_CURRENT, 
    // CLEAR_CURRENT 
} from './types';

const initialState = {
    logs: null,
    current: null,
    loading: false,
    error: null
}

// eslint-disable-next-line import/no-anonymous-default-export
export default(state = initialState, action) => {
    switch(action.type) {
        case SET_LOADING:
            return {
                ...state,
                loading: true,
            }
        default:
            return state;
    }
}
